import './App.css'
import './'

function App() {
  const name = 'Pedro'

  const newName = name.toUpperCase()

  function Sum(a, b) {
    return a + b
  }

  const url = 'http://via.placeholder.com/150'

  return(
    <div className='App'>
      <h2>Olá {newName}!</h2>
      <p>Essa é a sua primeira App</p>
      <p>Soma: {Sum(10, 11)}</p>
      <img src={url} alt='Minha imagem' />
    </div>
  );
}

export default App
